import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TimeElapsed = () => {
  const [startTime, setStartTime] = useState(null);
  const [elapsedTime, setElapsedTime] = useState(null);

  useEffect(() => {
    const interval = setInterval(() => {
      const now = new Date();
      if (startTime) {
        const elapsed = now - startTime;
        setElapsedTime(elapsed);
      }
    }, 1000); // Update every second

    return () => clearInterval(interval);
  }, [startTime]);

  return <div>Elapsed Time: {elapsedTime ? (elapsedTime / 1000).toFixed(2) : 0} seconds</div>;
};

const PrimeComponent = () => {
  const [primeRecords, setPrimeRecords] = useState([]);

  useEffect(() => {
    handleGetPrimeRecords();
  }, []);

  const handleGetPrimeRecords = async () => {
    try {
      const response = await axios.get('http://localhost:3001/api/data');
      setPrimeRecords(response.data);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div>
     
      <div className='text-center justify-center bg-green-50 '>
        <div className='text-purple-600 font-bold text-2xl hover:text-purple-900 p-6'> Prime Number Records</div>
        
          <ul>
          {primeRecords.map((record, index) => (
          <li key={index}>
            <p className='text-semibold text-green-900 text-lg'>Date: {record.Date}</p>
            <p className='text-semibold text-green-900 text-lg'>Start: {record.start}</p>
            <p className='text-semibold text-green-900 text-lg'>End: {record.end}</p>
            <p className='text-semibold text-green-900 text-lg'>Algorithm: {record.algorithm}</p>
            <p className='text-semibold  text-green-900 text-lg'>Elapsed time:</p> {/* Move TimeElapsed outside of p */}
            <p className='text-semibold  text-green-900 text-lg'><TimeElapsed /></p>
            <div className='h-[0.1rem] border my-2  bg-green-400 border-purple-400'></div>
          </li>
        ))}
          </ul>
    
      </div>
    </div>
  );
};

export default PrimeComponent;
